import React from "react";
import styled from "styled-components";

const AppFilter = () => {
  return (
    <SelectWrapper className="col-4 mt-5 position-relative">
      <select className="filter-select w-100 px-2">
        <option className="" data-cont="africa">
          Africa
        </option>
      </select>
    </SelectWrapper>
  );
};

export default AppFilter;

const SelectWrapper = styled.div`
  .filter-select:focus {
    outline: none;
  }
  &:before {
    content: "";
    position: absolute;
    top: 0;
    left: 0;
    width
  }
`;
